import axios from "axios";


export const upbitoinApi = {
    getMarketCodes: () =>
        axios.get("https://api.upbit.com/v1/market/all?isDetails=false")
};

export const bithumbcoinApi = {
    getMarketCodes: () =>
        axios.get("https://api.bithumb.com/public/ticker/ALL_KRW")
};
